import React from 'react';

function MerchSuggestions() {
  return (
    <div className="card my-4">
      <div className="card-body">
        <h2 className="card-title">Merchandising Consigliato</h2>
        <p className="card-text">Prodotti correlati ai tuoi anime preferiti <span className="badge bg-secondary">prossimamente!</span></p>
      </div>
    </div>
  );
}

export default MerchSuggestions;
